  false,\n\t\"url\": null,\n\t\"notes\": \"This proposed project would enable the
  Gunnison Climate Working Group, a chartered partnership of 14 public and private
  organizations in the Upper Gunnison Basin, CO, to: 1) complete a science-based vulnerability
  assessment of species and habitats in the Upper Gunnison Basin and identify data
  gaps; 2) develop a watershed-wide adaptation strategy for priority species and systems,
  based on the vulnerability assessment; 3) design and implement a local adaptation
  demonstration project for priority species and habitats; and 4) document tools,
  methods, and lessons learned to share with others across the SRLCC through a climate
  adaptation learning network. This work is critical to the development, application,
  testing and dissemination of concrete, hands-on methods that managers can use to
  sustain species and ecological systems in the face of climate change methods that
  will be shared widely with natural resource managers and conservation practitioners
  throughout the Southern Rockies LCC and beyond.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
